import "./App.css";
import React from "react";

function Nav() {
  return (
    <nav>
      <h3>Logo</h3>
      <ul className="nav-links">
        <li>View</li>
        <li>Modify</li>
      </ul>
    </nav>
  );
}

export default Nav;
